import React from "react";
import Navbar from "../components/Navbar";
import Homepage from "../components/homepage/Homepage";
const products = [
  {
    id: 1,
    name: "Beauty Bursh",
    description: "Lorem ipsum dolor sit amet.",
    price: "$30",
    image: "img1",
  },
  // ... add other products here
];
const Home = () => {
  return (
    <>
      <Navbar />
      <Homepage />
    </>
  );
};

export default Home;
